pub fn get_contract_instance_initialization_hash_avm(address: AztecAddress) -> Option<Field> {
    let (member, exists) = get_contract_instance_initialization_hash_internal_avm(address);
    if exists {
        Option::some(member)
    } else {
        Option::none()
    }
}

